<h2>INTERSECTP-EQ</h2>test whether two lists of symbols intersect
<pre>Major Section:  <a href="PROGRAMMING.html">PROGRAMMING</a>
</pre><p>

See <a href="INTERSECTP-EQUAL.html">intersectp-equal</a>, which is logically the same function.
<p>
<code>(Intersectp-eq x y)</code> has a <a href="GUARD.html">guard</a> that <code>x</code> and <code>y</code> are lists of
symbols.
